import React from 'react';
import logo from './logo.svg';
import './App.css';
import practiceCode from './practiceCode/code.js'
import { Route, Router } from 'react-router-dom';

function App() {
  return (
    <div className='background' >
      <div>
        <Router>
        <ul>
        <li><Route path='/' component={practiceCode}></Route></li>
        <li><a href="default.asp">About</a></li>
        {/* <li><a href="news.asp">Pra</a></li> */}
        {/* <li><a href="contact.asp">Contact</a></li> */}
        <li><a href="about.asp">Practice Code</a></li>
      </ul>
        </Router>

      </div>
    </div>

  );
}

export default App;
